  constructor(){
    super();
  }
  render(){
      this.state={
        monsters:[{name:'srikanth',id:1},{name:'pavan',id:2},{name:'john',id:3},{name:'robert',id:10}]
      }

    return (
      <div className="App">
        {this.state.monsters.map(el=> 
          {
            return <div key={el.id}><h1>{el.name}</h1></div>
          })}
      </div>
    );
  }

  }

export default App;
